import React from 'react';
import { GoogleLogin } from 'react-google-login';
import Helpers from '../../../Config/Helpers';
import axios from 'axios';
const LoginWithGoogle = () => {
    const responseGoogle = async (response) => {
        console.log("Token from Google:", response.tokenId);
        await sendTokenToBackend(response.tokenId);
    };

    const sendTokenToBackend = async (googleToken) => {
        const apiURL = Helpers.apiUrl; // Ensure this is correctly defined
        try {
            const response = await axios.post(`${apiURL}/auth/google`, { usertoken: googleToken }, {
                headers: {
                    Accept: "application/json",
                    "Content-Type": "application/json",
                },
            });

            if (response.status === 200) {
                console.log("Success:", response.data);
            } else {
                console.log("Response received:", response.data);
            }
        } catch (error) {
            if (error.response) {
                console.error("Error fetching details:", error.response.data);
            } else {
                console.error("Error fetching details:", error.message);
            }
        }
    };

    return (
        <GoogleLogin
            clientId="341429096489-e24lk8sq54ku9blm9o68v558pqces2mo.apps.googleusercontent.com" // Replace with your actual client ID
            buttonText="Login with Google"
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            cookiePolicy={'single_host_origin'}
            scope="profile email https://www.googleapis.com/auth/userinfo.email"
        />
    );
};

export default LoginWithGoogle;
